import React from "react";
import { Card } from "antd";
import Avatar from "antd/lib/avatar/avatar";

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta title="Hyoil" avatar={<Avatar>Hyoil</Avatar>} />
    </Card>
  );
};

export default UserProfile;
